import { DUMMY_DATA } from "../data.js";

export default function InsideDustState(props) {

  let selectSet = props.dusts;
  let selectDust = "";

  if (selectSet >= 0 && selectSet <= 30) {
    selectDust = "good";
  } else if (selectSet > 30 && selectSet <= 80) {
    selectDust = "average";
  } else if (selectSet > 80 && selectSet <= 150) {
    selectDust = "bad";
  } else if (selectSet > 150) {
    selectDust = "very_bad";
  }

  let tabContent = "test";

  if (selectDust) {
    tabContent = (
      <div>
        <h2>{DUMMY_DATA[selectDust].dust}</h2>
        <p>{DUMMY_DATA[selectDust].description}</p>
      </div>
    );
  }

  return (
    <>
     
      <div>{tabContent}</div>
    </>
  );
}
